export default function GamesList({games})
{

    const gamesList=games.map((game)=>(
        <Game key={game.id} id={game.id} title={game.title} gameURL={game.gameURL}/>
    ))
   return  (<ul className="mt-4 space-y-2">{{gamesList}}</ul>)
}
